import React, { Fragment } from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

import Navbar from './core/Navbar';
import './App.css';

function App() {
  return (
    <Router>
      <Fragment>
        <Navbar />
        <Switch></Switch>
      </Fragment>
    </Router>
  );
}

export default App;
